import React, { useState, useEffect } from 'react';
import Fuse from 'fuse.js';

function SchoolwisePC() {
    const [schoolData, setSchoolData] = useState([]);
    const [filteredSchools, setFilteredSchools] = useState([]);
    const [selectedSchoolData, setSelectedSchoolData] = useState([]);
    const [query, setQuery] = useState('');

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await fetch('http://localhost:4300/get-pc');
                if (response.ok) {
                    const data = await response.json();
                    setSchoolData(data);
                    setFilteredSchools(data); // Initialize filtered data with all records
                } else {
                    throw new Error('Network response was not ok.');
                }
            } catch (error) {
                console.error('Error fetching data: ', error);
            }
        };

        fetchData();
    }, []);

    const fuse = new Fuse(schoolData, {
        keys: ['schoolname', 'eiin'],
        includeScore: true,
        threshold: 0.3 // Adjust for less or more strictness
    });

    const handleSearch = (pattern) => {
        setQuery(pattern);
        if (!pattern) {
            setFilteredSchools(schoolData); // Reset when query is cleared
        } else {
            const results = fuse.search(pattern);
            const matches = results.map(result => result.item);
            setFilteredSchools(matches);
        }
        setSelectedSchoolData([]); // Clear detailed view on new search
    };

    const handleSelectSchool = (schoolName) => {
        // Filter all data for the selected school and update state to render it
        const schoolSpecificData = schoolData.filter(item => item.schoolname === schoolName);
        setSelectedSchoolData(schoolSpecificData);
    };

    return (
        <div className="container mt-5">
            <input
                type="text"
                className="form-control mb-3"
                placeholder="Search by school name or EIIN..."
                value={query}
                onChange={(e) => handleSearch(e.target.value)}
            />
            {filteredSchools.length > 0 && (
                <ul className="list-group">
                    {filteredSchools.map((item, index) => (
                        <li key={index} className="list-group-item list-group-item-action" onClick={() => handleSelectSchool(item.schoolname)}>
                            {`${item.schoolname} (EIIN: ${item.eiin})`}
                        </li>
                    ))}
                </ul>
            )}
            {selectedSchoolData.length > 0 && (
                <div className="mt-4">
                    <h4 className='text-center'>Details for {selectedSchoolData[0].schoolname}</h4>
                    <table className="table table-striped">
                        <thead>
                            <tr>
                                <th>#</th>
                                <th>PC Name</th>
                                <th>Start Time</th>
                                <th>Last Time</th>
                                <th>Total Time (s)</th>
                                <th>Lab Number</th>
                                <th>PC Number</th>
                                <th>Day ID</th>
                                <th>EIIN</th>
                            </tr>
                        </thead>
                        <tbody>
                            {selectedSchoolData.map((item, index) => (
                                <tr key={index}>
                                    <td>{index + 1}</td>
                                    <td>{item.pcname}</td>
                                    <td>{item.starttime}</td>
                                    <td>{item.lasttime}</td>
                                    <td>{item.totaltime}</td>
                                    <td>{item.labnum}</td>
                                    <td>{item.pcnum}</td>
                                    <td>{item.dayid}</td>
                                    <td>{item.eiin}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            )}
        </div>
    );
}

export default SchoolwisePC;
